import React from "react";

function Home() {

    const homeStyle = {
        padding: 0,
        height: "1%",
        width: "100%"
    }

    return (
        <>
            <h1 text>Home</h1>
            <img src="https://www.carvemag.com/wp-content/uploads/2016/03/Press-7.jpg" alt="surfer" style={homeStyle} />

        </>
    )
}

export default Home
